def dailyTemperatures(temperatures):
    output=[]
    for i in range(1, len(temperatures)):
        if temperatures[i-1] == max(temperatures):
            output.append(0)
            continue
        count = 0
        end = 0
        if temperatures[i] > temperatures[i-1]:
            output.append(1)
        else:
            for tem in temperatures[i:]:
                if tem > temperatures[i-1]:
                    count += 1
                    end = 0
                    break
                else:
                    count += 1
                    end = 1
            if end:
                output.append(0)
            else:
                output.append(count)

    output.append(0)
    return output

